@Component({
  selector: 'app-skill-list',
  templateUrl: './skill-list.component.html',
  styleUrls: ['./skill-list.component.css']
})
export class SkillListComponent {
  skilllist: any [];

  constructor(){
    this.skilllist = [
      {title: "HTML5", value: 95},
      {title: "Javascript / Typescript", value: 90}
    ]
  }
}
